import s from './Friend.module.css'
import {NavLink} from "react-router-dom";

const Friend = (props) => {
    return (
        <nav>
            <a>
                <NavLink to={"/messages/" + props.id}
                         className={navData => navData.isActive ? s.activeLink : s.item}>{props.name}</NavLink>
            </a>
        </nav>
    );
};

export default Friend;
